  const [name, setName] = useState("");

  function RecibirName(e) {
    e.preventDefault();
    setName(e.target.value);
  }

  function Buscar(e) {
    e.preventDefault();
    dispatch(getNameCountry(name));
  }
  return (
    <div>
      <input type="text" placeholder="Buscar pais" value="n"></input>
      <button type="submit">Buscar</button>
    </div>
  );
};

